import Header from './Header';
import Footer from './Footer';
import Head from 'next/head';

const Layout = props => (
  <div>
    <Head>
      <link rel="shortcut icon" href="./static/favicon.png" />
    </Head>
    {/* <Header /> */}
    {props.children}
    <Footer />
  </div>
);

export default Layout;
